import {
  BrowserRouter,
  Routes,
  Route,
} from "react-router-dom";
import HeaderComponent from "./pageElements/Header";
import Home from './pages/Home';
import About from './pages/About';

function App() {
  return (
    <div className="App">
       <Routes>

          <Route path="/" element={<App />}></Route>
          <Home />
          <About />
      </Routes>
    </div>
  );
}

export default App;
